              ["max", "maxDate"],
              ["dayFormat"],
              ["monthFormat"],
              ["yearFormat"],
              ["dayHeaderFormat"],
              ["dayTitleFormat"],
              ["monthTitleFormat"],
              ["showWeeks"],
              ["startingDay"],
              ["yearRange"],
              ["datepickerOptions", "dateOptions"]
